params.xOn:formValidationError.window:
if ($event.detail.livewireId !== 'FOhLjjwTf1RfChyDxqxC') {
                return
            }

            $nextTick(() => {
                let error = $el.querySelector('[data-validation-error]')

                if (! error) {
                    return
                }

                let elementToExpand = error

                while (elementToExpand) {
                    elementToExpand.dispatchEvent(new CustomEvent('expand'))

                    elementToExpand = elementToExpand.parentNode
                }

                setTimeout(
                    () =>
                        error.closest('[data-field-wrapper]').scrollIntoView({
                            behavior: 'smooth',
                            block: 'start',
                            inline: 'start',
                        }),
                    200,
                )
        })

params.xOn:modalClosed.stop:
const mountedActionShouldOpenModal = false


if (! mountedActionShouldOpenModal) {
    return
}

if ($wire.mountedFormComponentActions.length) {
    return
}

$wire.unmountAction(false, false)
